import React, { Component } from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css'; 
import 'slick-carousel/slick/slick-theme.css';


class Popularlocations extends Component {
    render (){

        const settings = {
            rows: 2,
            slidesToShow: 2,
            slidesToScroll: 1,
            slidesPerRow:2,
            dots: true
        };
        return (
            <div>
            <Slider {...settings}>
            <div>
            <h3>1</h3>
          </div>
          <div>
            <h3>2</h3>
          </div>
          <div>
            <h3>3</h3>
          </div>
          <div>
            <h3>4</h3>
          </div>
          <div>
            <h3>5</h3>
          </div>
          <div>
            <h3>6</h3>
          </div>
          <div>
            <h3>7</h3>
          </div>
          <div>
            <h3>8</h3>
          </div>
            </Slider>

            </div>
        );
    }
}
export default Popularlocations
